  render(){
    return(
      <main>
  <div className="eventpic-container">
    <img src="pic/event1.jpg" alt="about" className=""></img>
    <img src="pic/event2.jpg" alt="rapportera" className=""></img>
    <img src="pic/event3.jpg" alt="help" className=""></img>
    <img src="pic/event4.jpg" alt="help" className=""></img>
    <img src="pic/event5.jpg" alt="help" className=""></img>
  </div>
  <h1 id="event-h1">Evenemangskalender</h1>
  <p id="event-p">Hitta event event</p>
  <input id="input" type="text" placeholder="SÃ¶k event" />
  <br />
  <table className="event">
    <tbody id="eventTable">
      <tr>
        <th>Aktivitet</th>
        <th>Datum</th>
        <th>Kontaktperson</th>
        <th>Plats</th>
      </tr>
      {/* table rows */}
    </tbody>
  </table>
</main>

    );
  }
}

export default Event;
